(11, 10013, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '10 ATM', 'Mineral Crystal (Kính Cứng)', '', '', 'Dây da', '', 'Đồng hồ Casio LTP-V002L-1AUDF dành cho phái nữ với kiểu dáng và màu sắc tinh tế đơn giản, nhẹ nhàng nhưng không kém phần quyến rũ và hâp dãn', '2 năm', 'hinh1.jpg'),
(110, 10012, 'Đồng hồ Nam', 'Quartz (Điện tử)', '10 ATM', '	\r\nMineral Crystal (Kính Cứng)', '43 mm', '', 'Thép không gỉ', '', 'Đậm chất nam tính đến từ mẫu Seiko SKS592P1 với phiên bản tổng thể đồng hồ được bao phủ tông màu vàng sang trọng cuồn hút, và không kém phần thể thao với kiểu dáng 6 kim kèm theo chức năng Chronograph', '5 năm', 'SKS592P1-399x399.jpg'),
(11011, 10001, 'Đồng hồ Nam', 'Quartz (Điện tử)', '10 ATM', 'Mineral Crystal (Kính Cứng)', '', '', 'Thép không gỉ', '', 'Đồng hồ Casio EQB-510D-1A dây kim loại được thiết kế pha trộn giữa cổ điển và hiện đại mang lại một phong cách mới lịch lãm, nam tính đầy ấn tượng dành cho phái mạnh', '12 tháng', 'EQB-510D-1A-W300.png'),
(11014, 10014, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '3 ATM', 'Mineral Crystal (Kính Cứng)', '28 mm', '', 'Thép không gỉ', '', 'Đồng hồ nữ cao cấp Orient FSZ40003W0 với chất liệu thép không gỉ mạ vàng sang trọng, dây đeo với kiểu dáng lắc tay mặt nền trắng cùng các chi tiết mạ vàng và 1 lịch ngày', '12 tháng', 'đh nam.jpg'),
(11015, 10015, 'Đồng hồ Nam', 'Automatic (Tự động)', '5 ATM', 'Mineral Crystal (Kính Cứng)', '44 mm', '13 mm', 'Dây da chính hãng', '', 'Mẫu Fossil ME3110 với nền mặt số xanh trẻ trung với mẫu đồng hồ 4 kim, kiểu thiết kế theo phong cách cổ điển với chữ số la mã, kết hợp cùng bộ dây da nâu đầy lịch lãm nam tính', '2 năm', 'ME3110-fossil.jpg'),
(11016, 10016, 'Đồng hồ nữ', 'Quartz (Điện tử)', '3 ATM', 'Kính Sapphire', '39 mm', '', 'Dây da', '', 'Đồng hồ Omega Deville - 0675M - Đồng hồ máy Nhật bản vơi lịch ngày và thứ tiện ích, mặt kính sapphire chống trây với dây da đen khỏe khoắn, vỏ làm bằng thép không rỉ mạ 18k', '12 tháng', 'omega_devill.jpg'),
(11017, 10017, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '30 mm', '', 'Dây nhựa', '', 'Đồng hồ hợp được sản xuất bởi thường hiệu QQ hết sức dễ thương và hợp với các bé', '10 năm tại shop', 'VR97J004Y-qq.jpg'),
(11018, 10018, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '3 ATM', 'Kính cứng chịu lực', '38 mm', '', 'Hợp kim thép', '', 'Đồng hồ được sản xuất hợp với gu sang chảnh của các bé, dộ bền và bắt mắt của đồng hồ thì chẳng thể bàn cãi', '5 năm tại shop', 'đh trẻ em.jpg'),
(11019, 10019, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '', '', '', '', 'Dây da', '', 'Phụ kiện đồng hồ', '30 ngày', 'D DM W 12-daynu.jpg'),
(11020, 10020, 'Đồng hồ Nữ/Nam', 'Quartz (Điện tử)', '', '', '', '', 'Dây da', '', 'Phụ kiện đồng hồ', '30 ngày', 'D DM B-RG16-qq.jpg'),
(11021, 10030, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '30 nm', '', 'Dây nhựa', '', 'Đồng hồ hợp được sản xuất bởi thường hiệu QQ hết sức dễ thương và hợp với các bé', '10 năm tại shop', 'vr28j006y.jpg'),
(11022, 10032, 'Đồng hồ Nam', 'Quartz (Điện tử)', '10 ATM', 'Mineral Crystal (Kính Cứng)', '44 mm', '', 'Thép không gỉ', '', 'Sản phẩm được thiết kế với dây kim loại được thiết kế pha trộn giữa cổ điển và hiện đại mang lại một phong cách mới lịch lãm, nam tính đầy ấn tượng dành cho phái mạnh', '2 năm', '1avudf.jpg'),
(11023, 10034, 'Đồng hồ Nam', 'Automatic (Tự động)', '5 ATM', 'Mineral Crystal (Kính Cứng)', '44 mm', '13 mm', 'Thép không gỉ', '', 'Dòng đồng hồ này sử dụng năng lượng nhờ vào ánh sáng mặt trời và tự động sạc pin, ngoài ra còn được bổ sung thêm lịch vạn niên với chức năng tự động điều chỉnh ngày tháng. Nổi bật trong bộ sưu tập này là mẫu đồng hồ Eco-Drive Twin-Date Perpetual Calendar. Nó có khả năng hiển thị ngày tháng rất lớn nhờ vào hai đĩa lịch lớn bên dưới mốc 12 giờ; mỗi đĩa được truyền động bởi động cơ riêng và ngày tháng tự thay đổi theo chuyển động của kim giờ khi tiến hoặc lùi thời gian.', '2 năm', 'nh835059e.png'),
(11024, 10035, 'Đồng hồ Nam', 'Quartz (Điện tử)', '5 ATM', 'Kính cứng chịu lực', '44 mm', '13 mm', 'Dây da', '', 'Mẫu mã của đồng hồ Q&Q vô cùng đa dạng. Nó sở hữu đầy đủ từ những kiểu dáng kinh điển truyền thống đến các thiết kế độc đáo, từ thể thao mạnh mẽ cho đến dịu dàng nữ tính, kể cả sang trọng quý phái cho các quý cô hay lịch lãm, thời thượng dành cho các quý ông …', '5 năm tại shop', 'qq-s280j102y.jpg'),
(11027, 10036, 'Đồng hồ Nam', 'Quartz (Điện tử)', '5 ATM', 'Sapphire', '41 mm', '8 mm', 'Thép không gỉ', '', ' Đồng hồ Atlantic thể hiện cái tôi chuẩn mực nhưng phóng khoáng, một tầm nhìn xa, sâu sắc như chính tên thương hiệu đồng hồ. Với hàm ý của người sáng lập muốn sản phẩm như biển Đại Tây Dương rộng lớn, bao la và sâu thẳm.', '2 năm', 'at.jpg'),
(11028, 10037, 'Đồng hồ Nam', 'Quartz (Điện tử)', '5 ATM', 'Mineral Crystal (Kính Cứng)', '38 mm', '', 'Dây da', '20 mm', 'Jacques Lemans Geneve được sản xuất theo các chuẩn mực cao như: vỏ và dây đều được làm từ thép siêu cứng chất lượng cao L316, nếu là dây da đều được làm từ da cá sấu, mặt kính sapphire, dùng máy tiêu chuẩn ETA của Thụy sỹ hoặc với một số mẫu đặc biệt dùng máy tốt nhất của Thụy sỹ là Valjoux. Các dòng sản phẩm thông thường như đồng hồ quatz (điện tử) dùng máy Ronda (Thụysỹ) và Miyota (Nhật).', '2 năm', '1929h.jpg'),
(11029, 10038, 'Đồng hồ Nữ', 'Automatic (Tự động)', '3 ATM', 'Sapphire', '28 mm', '8 mm', 'Dây da', '', 'Thụy Sĩ đã đạt được danh tiếng trên toàn thế giới qua nhiều thế kỷ, nhờ tinh thần tiên phong và ý nghĩ độc đáo trong sự gia công hoàn hảo của đồng hồ. Nhiệm vụ EPOS là trở thành một người giám hộ, là thước đo của các giá trị truyền thống và các tiêu chuẩn cao. Đồng hồ EPOS được thiết kế và phát triển với niềm đam mê, được sản xuất với độ chính xác bởi những người thợ trong dãy núi Jura và những chuyên gia thời trang tại các hội thảo Vallée de Joux, được lắp ráp với sự tỉ mỉ, tinh xảo tại Grenchen, khu vực nổi tiếng nhất trong di sản đồng hồ thế giới.', '5 năm tại shop', 'epos.jpg'),
(11030, 10039, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '5 ATM', 'Kính cứng chịu lực', '28 mm', '8 mm', 'Hợp kim thép', '', 'Jacques Du Manoir là một thương hiệu đến từ Thụy Sỹ, bởi một gia đình có truyền thống 4 đời sản xuất đồng hồ. Họ mong muốn được mang đến những chiếc đồng hồ Thụy Sỹ chất lượng nhất với giá cả phải chăng cho tất cả mọi người', '2 năm', 'nro12.jpg'),
(11031, 10040, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '5 ATM', 'Sapphire', '28 mm', '', 'Thép không gỉ', '', 'Mong muốn phát huy những tinh hoa di sản của đồng hồ Thụy Sĩ. Aries Gold sớm trở thành một thương hiệu uy tín, cao cấp quốc tế. Đối với các nhà thiết kế và kỹ sư của Aries Gold  niềm đam mê sản xuất đồng hồ chính là  nguồn cảm hứng sáng tạo để chế tác những sản phẩm chất lượng cao nhất. Mỗi chiếc đồng hồ Aries Gold đều được hoàn thành dưới bàn tay tỉ mỉ, dày dặn kỹ năng và kinh nghiệm của các nghệ nhân bậc thầy .', '5 năm tại shop', '30.jpg'),
(11032, 10041, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '3 ATM', 'Sapphire', '28 mm', '', 'Hợp kim', '', 'Đồng hồ Diamond D mang đến cho khách hàng vẻ đẹp tinh tế, vĩnh cửu như những viên kim cương thuần khiết được tạo nên qua quá trình hàng triệu năm. Với thiết kế tinh xảo, mặt kính sử dụng đá saphia chống xước hoàn toàn đem đến cho quý khách một sản phẩm hoàn hảo với chất lượng vượt trội.', '2 năm', 'dm61195.jpg'),
(11033, 10042, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '3 ATM', 'Mineral Crystal (Kính Cứng)', '28 mm', '', 'Thép không gỉ', '', 'Nổi bật trong bộ sưu tập này là mẫu đồng hồ Eco-Drive Twin-Date Perpetual Calendar. Nó có khả năng hiển thị ngày tháng rất lớn nhờ vào hai đĩa lịch lớn bên dưới mốc 12 giờ; mỗi đĩa được truyền động bởi động cơ riêng và ngày tháng tự thay đổi theo chuyển động của kim giờ khi tiến hoặc lùi thời gian.', '5 năm tại shop', '2.jpg'),
(11034, 10043, 'Đồng hồ Nữ', 'Quartz (Điện tử)', '5 ATM', 'Sapphire', '28 mm', '', 'Ceramic', '', 'Hãy đến với Stuhrling để bạn cảm nhận được những nét thăng trầm của thời gian, để cảm nhận được tâm sức của cả 1 dòng họ suốt 4 thế hệ dành trọn vào nó, để cảm nhận được tinh hoa của thời gian được lắng đọng...\r\n\r\nHãng đồng hồ danh tiếng từ Thụy Sỹ Stuhrling lịch sử hơn 200 năm\r\n\r\n', '5 năm tại shop', 'st.jpg'),
(11035, 10044, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '38 mm', '', 'Dây nhựa', '', 'Với giá thành rẻ, chất lượng tốt và sở hữu những mẫu thiết kế trẻ trung, hiện đại đã được ưa chuộng tại hơn 150 quốc gia. Không hề quá lời khi khẳng định Q&Q đang chiếm ngôi vương trong phân khúc đồng hồ giá rẻ.', '10 năm tại shop', 'vq.jpg'),
(11036, 10045, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '38 mm', '', 'Dây nhựa', '', 'Không chỉ đẹp và nhiều kiểu dáng khác nhau để khách hàng lựa chọn, đồng hồ Q&Q còn nổi tiếng với chất lượng cực đảm bảo và điều này cũng không khó hiểu khi sáng lập ra danh hiệu đồng hồ Q&Q là tập đoàn Citizen lớn mạnh bậc nhất xứ Phù Tang.', '10 năm tại shop', '0y.jpg'),
(11037, 10046, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '28 mm', '', 'Dây nhựa', '', 'Vì giá thành hợp túi tiền nên đồng hồ Q&Q được yêu thích rất nhiều, nhận được sự ủng hộ của hầu hết mọi đối tượng. Từ các doanh nhân thành đạt cho đến các bạn sinh viên, từ nhân viên văn phòng và cả chị em nội trợ, ai cũng hài lòng với vẻ bề ngoài và sự thời thượng bên trong cấu trúc, phù hợp với thị hiếu của cộng đồng.\r\n\r\n', '5 năm tại shop', '4y.jpg'),
(11038, 10047, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '38 mm', '', 'Dây nhựa', '', 'Đây là hãng đồng hồ chất lượng cao nhưng giá rẻ toàn cầu, vì thế chi phí để có một chiếc đồng hồ Q&Q vô cùng dễ chịu. Có thể nói rằng Q&Q là loại đồng hồ thành công nhất trong cuộc đua về chất lượng và giá thành. Chỉ từ 300.000 đồng là chúng ta đã có thể sở hữu một chiếc đồng hồ Q&Q chính hãng', '2 năm', 'vq9.jpg'),
(11039, 10048, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '28 mm', '', 'Dây nhựa', '', 'Công nghệ kĩ thuật của các tập đoàn Nhật Bản đã không cần bàn cãi từ lâu, và Q&Q đã sở hữu những ưu điểm từ người sáng lập một cách đáng kể. Đồng hồ Q&Q không phải được chế tạo bằng một chất liệu đồng nhất. Do sự đa dạng về mẫu mã và thiết kế nên chất liệu làm đồng hồ cũng khác nhau giữa các dòng.', '10 năm tại shop', 'vq50.jpg'),
(11040, 10049, 'Đồng hồ trẻ em', 'Quartz (Điện tử)', '10 ATM', 'Kính cứng chịu lực', '28 mm', '', 'Dây nhựa', '', 'Vì giá thành hợp túi tiền nên đồng hồ Q&Q được yêu thích rất nhiều, nhận được sự ủng hộ của hầu hết mọi đối tượng. Từ các doanh nhân thành đạt cho đến các bạn sinh viên, từ nhân viên văn phòng và cả chị em nội trợ, ai cũng hài lòng với vẻ bề ngoài và sự thời thượng bên trong cấu trúc, phù hợp với thị hiếu của cộng đồng.', '5 năm tại shop', 'vr28.jpg'),
